ddfba833df99f8f92301eace36c336c026068660:
subscription JoinRootSubscription {
  authListener {
    authorized
    redirect
    cookie {
      sameSession
    }
  }
}

9d7faf285807018eb42ec3a20e99010017138ce2:
query tokenStateQuery {
  authentication {
    user {
      username
    }
    cookie {
      redeemed
      registered
      sameSession
    }
  }
}

ba17e0e5aa65763a09b71c780584698ee65676b0:
query tokenQuery(
  $cookie: String!
) {
  redeemCookie(cookie: $cookie) {
    sameSession
    registered
    redeemed
  }
}
